                    "#text": "This will DEFINITELY earn a fave point when we get it all done.  The first 3 were a piece of cake, though the writing on the 2nd stage is VERY faded and hard to read - needs to have some owner maintenance with a Sharpie.  However, when we got to #4, we got stopped.  Going to have to ask for a hint on this one, because we WILL be back."
