                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "6 / 51\nWe had a three-week holiday in USA\nFrom Dallas we drove  to north and all the way to North Dakota.\nWe visited a total of 11  states, Tx, Ar, Mo, Ia, Wi, Mn, Sd, Nd, Ne, Ks, Ok.\nWe drove over 4000 miles.\nWe found many good cache, but we also found many, many caches in need of maintenance.\nThe weather was changeable, cold and hot, wet and dry, calm, windy.\nThanks for the caches.\nGreetings from Finland Pele53 & Meka52\nSorry for copy and paste loggings."
                  }
