            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>Once again you will be looking for a Civil War Historic Marker. This is an easy Park and Grab ( bison tube), located in a Cemetery. Be respectful of other persons driving through, but there is parking very close to the cache.</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>Elmwood Cemetery in Mexico, Missouri is the final resting place to nearly 200 Civil War veterans, Union and Confederate.</p>\n\n<p>The marker will direct you to graves of Peter McCullough, \"The Hanging Judge of Andersonville Prison\". Another cache in this cemetery will explain the importance of his Civil War service.</p>\n\n<p>Private Bryon S. HIte, born in Virginia. In 1861 fought in the battles of Springfield, Carthage, and Lexington. 1862 , during Col. Joseph Porters raid, he enlisted with Sniders Battalion of Missouri Cavalry (CSA) and was wounded during Porter's withdrawl  to Arkansas in October 1862. In 1878 Hite patented his \"Hite Heat Fender\", a ventilation system for cook stoves. He opened a factory in Mexico and accumulated a fortune.</p>\n\n<p>Another grave to visit would be Colonel Bazel Lazear who commanded the First Missouri State Militia Cavalry 1863-1964. His regiment chased and lost William Quantrells partisan cavalry during Quantrells Lawrence, Kansas raid.</p>\n\n<p>Elmwood also contains the graves of two brothers David and Walker Lillard, who served in a MO USCT regiment, and after the war help found the 2nd Missionary Baptist Church.</p>\n\n<p>This marker will contain other stories of Civil War Veterans. A grant from the City of Mexico Parks and Recreation made this marker possible.</p>"
            }, 
