                    "#text": "FTF!  [:D]\n\nTrillian and I were at Fulton High School, wrapping things up after Young Zaphod and his fellow Hornets had concluded their tennis meet up with the Boonville Pirates. Packing away my chair, I heard a loud PING! \n\nNew email! \n\nLemme just go check it out. A new cache, eh? No wait...not just one...not even two. Three new ones!Hmmmm...they are up in my hometown of Mexico! Daylight is starting to fade, but just maybe I might be able to go get them! So, after some convincing of Trillian to let me go, punctuated with a promise of a gift of chocolate to her, she allowed me to go. I dropped Trillian and Young Zaphod off at home and took off toward Mexico.\n\nI went after this one first, simply because it was at a cemetery and daylight was starting to leave. I got to the area in time for it to be somewhat light out and before I even stopped the geo-mobile, I had an idea where it was. I hopped out of the car and quickly had cache in hand. Opening it up, I was greeted with a pristine log! Yay! I happily signed the FTF spot, put everything back as it was and headed off to the next cache.\n\nYou get a favorite point for the awesome historical aspect of the cache. Thanks for placing this cache for everyone, myself included, to enjoy. TNLN/SL\n\nYes, we know where our towels are...\n\n-Fulton, MO"
