                    "@encoded": "False", 
                    "#text": "OCW el-mo on the way to celebrate Christmas with family, we decided to stop by and finally make the grab on this one today.  I've been here two or three times previously, and the last time I was here, I was within inches of the cache location, but caution won out.  After my last visit, I did an EAF, and with armed with a hint, I was able to return with my lovely wife today, and make the grab very quickly.  The biggest problem I had today was that the alley and whole area was iced up and slick as greased owl snot.  The important thing is, though, we made the find and filled in another calendar day.  Thank you for placing this tough cache, jsmtech!"
