                    "#text": "Heading to Geocoinfest in Omaha, Nebraska and this was our first cache of the day. This was a doosey, Mr. Q had to grab it for us. Thanks for the fun here dboss71 and thanks to the owner of establishment for allowing the game piece to be placed here."
