                    "#text": "Thanks for your commitment to  geocaching. I know your fellow cachers appreciate your efforts.\n\n\n***Thanks a MILLION, Glenn*** \n***\"Seek quality, not quantity\"***\n--Your friendly Missouri Geocache Review team is:\n ***[*gln](http://www.geocaching.com/profile/?u=*gln), [Mongo](http://www.geocaching.com/profile/?u=Mongo) and [Banjo-Boy](http://www.geocaching.com/profile/?u=Banjo-Boy)***\n \n----\n\"When you go to hide a geocache, think of the reason you are bringing people to that spot. If the only reason is for the geocache, then find a better spot.\" \u2013 briansnat\nJuly 9, 2016 6:32 PM by *gln"
