                    "@encoded": "False", 
                    "#text": "Rolling Hills of Northern Missouri #9 (9:29 AM)\n\nGeese called out overhead as they flew by.  Atomic Goat's Breath and I admired them briefly before seeing to the matter at hand.  We had a geocache to find, and our initial ideas were not bearing fruit.  Goat soon pointed out the container, and I simply had to shake my head in dismay.  How had I overlooked this one?  With a sign of the log, we were back on the road."
