                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Woo-Hoo! #4 (2:45 PM)\n\nHaving passed up this cache over the years for varying reasons, this day proved to be the one for a visit!  Atomic Goat's Breath and I drove straight from Ten Mile in the hopes that this older hide would still be in good shape.  Parking was easy to find, and, after a brief stroll through the grass, the container was ours.  Nice hiding spot!  Given its age, the geocache was found to be in good shape.  A quick sign to the log saw our return to the car and eventual return to highway 36."
                  }
