            "groundspeak:short_description": {
              "@html": "False", 
              "#text": "The 9th installment in the Boys of Summer Series revolves around Bob \"Riverboat\" Smith.  Riverboat only played 2 years in the big leagues, but in 1958 he pitched in 17 games for the Boston Red Sox with a record of 4-3.  A man by the name of Ted Williams played on that team also, some of you may have heard of him.  I also had the pleasure of talking to one of Riverboat's childhood friends that said he had never seen anyone with better stuff than Riverboat."
            }, 
            "groundspeak:long_description": {
              "@html": "False", 
              "#text": "Waypoint #1 will take you to the final resting place of Riverboat Smith.  At this location you will need the following information.  \nWhat year was the Union Church established?    ABCD\n\nThe final cache is a very small nano about the size of a fingernail.  It is located at:   N   39.44.8BC\n                                        W 092.15.A8B\n\nThis are may take a great deal of stealth during the summer months of an evening.  Please bring your own pencil for logging.\n\nFTF Bubba002\n\nAdditional Waypoints"
            }, 
            "groundspeak:encoded_hints": "If you are left scratching your head, try taking your cap off.", 
