                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Find # 0009038\nCounty: Monroe, Missouri\nDelorme Grid: MO-031\n\nDay 3 of my Midwest Journey to Geowoodstock XII from Des Moines, IA.  Today was the day I finally arrived at GW XII.  I started the journey in Colombia, MO but had a lot of counties to clean up in Missouri before I finally made it to the event location.  Even though it was about 100 miles from Columbia to St. Charles, I think I wound up driving over 300 miles to get a whole bunch of caches up to Hannibal and after zigging and zagging around.  Weather was good most of the day, however the muggle factor was rather intense on the Friday before Memorial Day and law enforcement was everywhere and were extrememly intense!\n\nAlmost didn't pull into the driveway when I realized how \"private\" this area was.  But re-read the cache description and saw everything was okay.  Pulled in around 9:30am in my Black Nissan Senta (rented) and found nobody out and about.  I quickly found the cache and signed it, noting the attachment is not really attached to the container anymore, but it will hold for now.  Looked for the CO to see if they were out and about on the farm but did not see anybody.  Waved at the house on the way out and continued on my journey.\n\nTFTC and sharing the wonderful views from your property."
                  }
