                    "#text": "OCW Schrempa this weekend at Mark Twain grabbing some caches. We did a lot of hiking and picked off close to 100 ticks only had about 25 that had dug in the first day.  So today we decided to get more of the quick ones around town.  All in all we had a great time grabbing these great caches. Thanks for placing this cache."
